// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

// import  nodeModules/openzeppelin/contracts/token/ERC20 
import "../node_modules/openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";

contract EthSwap{
    // ERC20  token 
    //   ERC20      
    // KaiToken.sol       token  
    //   .
    ERC20 public token;

    //   
    uint public rate = 100;

    constructor(ERC20 _token){
        // CA .
        token = _token;
    }

    function getToken() public view returns(address){
        // KaiToken CA
        return address(token);
    }

    function getSwapBalance()public view returns (uint){
        // token.balanceOf()   
        return token.balanceOf(msg.sender);
    }

    //   
    function buyToken() public payable{
        uint256 tokenAmount = msg.value * rate;
        // this    this == EthSwap
        // address(this) ==   CA
        // require      2    
        //       
        //          .
        //      gas  
        require(token.balanceOf(address(this)) >= tokenAmount, "err");
        token.transfer(getToken(), tokenAmount);
    }
    // function buyToken(address user, uint value) public payable{
    //     uint256 tokenAmount = value * rate;
    //     // this    this == EthSwap
    //     // address(this) ==   CA
    //     // require      2    
    //     //       
    //     //          .
    //     //      gas  
    //     require(token.balanceOf(address(this)) >= tokenAmount, "err");
    //     token.transfer(user, tokenAmount);
    // }
    //   
    function sellToken(uint256 _amount) public payable{
        require(token.balanceOf(msg.sender) >= _amount);
        uint256 etherAmount = _amount/rate;
        require(address(this).balance >= etherAmount);
        token.transferFrom(msg.sender, address(this), _amount);
        payable(msg.sender).transfer(etherAmount);
    }
}
